  const { contract } = useContext(ComponentContext);
  console.log(contract);
  return (
    <>
      <div className="createProp-box">
        <h2>Create Your Proposal</h2>
        <form action="">
          <input type="text" name="" id="" placeholder="Proposal Descriton" />
          <input type="text" name="" id="" placeholder="Amount in (Wei)" />
          <input type="text" name="" id="" placeholder="Recipient Address" />
          <button type="submit">Create</button>
        </form>
      </div>
    </>
  );
};

export default CreateProposal;
